import React from 'react';
import { Carousel } from 'react-bootstrap';
import item1 from '../pictures/photo.jpg';
import item2 from '../pictures/barber.jpg';
import item3 from '../pictures/beard trimming.jpg';
import logo from '../pictures/head.png';
import styled from 'styled-components';

const Styles = styled.div`
.carousel-item .img-fluid {
  width: 100%;
  height: 100%;
}
.index {
  z-index: -1;
  position: absolute;
}


`

function Home() {
  return (
    <Styles>
      <Carousel>
        <Carousel.Item>
          <img
            className="d-block w-100 index"
            src={item1}
            alt="First slide"
          />
          <p>Barber</p> 
          <img src={logo} />
          <p> Andrew</p>
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100 index"
            src={item2}
            alt="Third slide"
          />
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100 index"
            src={item3}
            alt="Third slide"
          />
        </Carousel.Item>
      </Carousel>
    </Styles>
  )
}

export default Home;
